import React from "react";
import { Row, Col, Card } from "react-bootstrap";

export default function Dash2() {
  return (
    <div>
      <div>
        <Row className="border">
          <Col sm={4}>
            <Card style={{ width: "18rem" }}>
              <Card.Header>Card1</Card.Header>
              <Card.Body>
                <Card.Text>This is card 1</Card.Text>
              </Card.Body>
            </Card>
          </Col>
          <Col sm={4}></Col>
          <Col sm={4}></Col>
        </Row>
      </div>
    </div>
  );
}
